import React,{Component} from 'react';
import Cookies from "universal-cookie";

export default class DashBoard extends Component{
    constructor()
    {
        super()
    }



    logout = async () => {


        const cookies = new Cookies();
        cookies.remove("uname");
        window.location.href = "http://localhost:3000/";


    };
    render()
    {
        return(
            <div>
                <br/>
                <button class="logout" onClick={async () => {await this.logout();}} >Logout</button>
                <br/><br/>
                <div className="main-container">
                <center>
                <div className="dashboard-container">

                    <div className="image-card">
                        <div className="image-instance"></div>
                            <div className="btn-group">
                            <button className="btn">Block</button><button className="btn">Like</button><button className="btn">Super Like</button>
                            </div>
                        </div>
                    </div>
                </center>
                </div>

            </div>
        );
    }
}
